import React from 'react'
import Logo from "./img/logoStock.png"

export const StockFooter = () => {
  return (
    <footer className="bg-black py-6 text-white">
        
        <div class="grid grid-cols-3 gap-4">
            <div class="col-span-1 p-4"></div>
            <div class="col-span-1 p-4"></div>
            <div class="col-span-1 p-4">Columna 3</div>
        </div>

      
    </footer>
  )
}
